import React from 'react';
import '../../App.css';
import LocationSection from '../LocationSection';
import '../LocationSection.css';


import GoogleMapReact from 'google-map-react'
import Marker from '../Marker'


const Map = ({lattitude, longitude}) => {
  const coordinates = { lat: 0, lng: 0 }
  return (
   <div className='map'>
      <LocationSection />   

      <GoogleMapReact>
        bootstrapURLKeys={{ key: 'AaosjbnsajsnbjIUYIkbbaskjbd' }}
        defaultCenter={coordinates}
        center={coordinates}
        defaultZoom={14}
        margin={[50, 50, 50, 50]}
        options={''}
        onChange={''}
        onChildClick={''}
      </GoogleMapReact>
          {/* <GoogleMapReact>
                    bootstrapURLKeys ={{ key: "AIzaSyDUnHLz8Esrh1pWB8W04uJC95LoEmINBcI" }}
                    defaultCenter={{lat: 16.7050, lng: 74.2433}}
                    defaultZoom={ 14 }
                >   

                <Marker lat={lattitude} lng={longitude}/>


                </GoogleMapReact>
 */}
    </div>
  );
}

export default Map
